var title_f16_42_17071="Algorithm for the treatment of HLH and MAS";
var content_f16_42_17071=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F65737&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F65737&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 542px\">",
"   <div class=\"ttl\">",
"    Algorithm for the treatment of hemophagocytic lymphohistiocytosis and macrophage activation syndrome",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 522px; height: 516px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <p>",
"     &nbsp;",
"    </p>",
"    <div class=\"footnotes\">",
"     HLH: hemophagocytic lymphohistiocytosis; MAS: macrophage activation syndrome; EBV: Epstein-Barr virus; CMV: cytomegalovirus; HIV: human immunodeficiency virus; JIA: juvenile idiopathic arthritis; HLH-94: HLH 1994 treatment protocol; CSA/Dex: treatment with cyclosporin + dexamethasone; XLP: X-linked lymphoproliferative syndrome; HCT: hematopoietic cell transplantation.",
"     <br/>",
"     * Check for mutations listed below. Since EBV, CMV, herpes, parvovirus, and many other viral infections can unmask HLH caused by one of these mutations, do NOT use presence of these infections to delay treatment with HLH-94. HCT is recommended for all patients &lt;2 years of age, those with CNS-HLH, poor response to the first eight weeks of HLH-94 (or relapse), and all those with homozygous mutations of perforin, MUNC13-4, XLP, and syntaxin genes.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     Griscelli &amp; Chediak-Higashi syndromes, XLP, Kawasaki disease. Rashes of HLH may resemble Kawasaki-type rashes. HCT is needed for the first three of these diseases and for Kawasaki disease if poor response to HLH-94.",
"     <br/>",
"     &Delta; Solid organ or bone marrow transplantation.",
"     <br/>",
"     <span class=\"lozenge\">",
"      &loz;",
"     </span>",
"     Bacterial or fungal infection, leishmaniasis, malaria.",
"     <br/>",
"     &sect;",
"     <sup>",
"     </sup>",
"     Alemtuzumab should be employed for unresponsive HLH and may allow patients to undergo HCT",
"     <sup>",
"      [1]",
"     </sup>",
"     .",
"    </div>",
"    <div class=\"reference\">",
"     Reference:",
"     <ol>",
"      <li>",
"       Marsh RA, Allen CE, McClain KL, et al. Salvage therapy of refractory hemophagocytic lymphohistiocytosis with alemtuzumab. Pediatr Blood Cancer 2012.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
